import React from "react";
import { Button, Gap, Input, TextArea, Upload } from "../../components";

function CreateBlog() {
  return (
    <div>
      <p>Halaman create blog</p>
      <Input label="Pos Title" />
      <Upload />
      <TextArea />
      <Gap height={20} />
      <div>
        <Button title="Save" />
      </div>
      <Gap height={20} />
    </div>
  );
}

export default CreateBlog;
